import React, { Component } from 'react';
import styled from 'styled-components';

const Navigation = styled.nav`
  display: flex;
  border: 1px solid black;
`;

class Nav extends Component {
  state = {};

  render() {
    return (
      <Navigation>
        <h1>recordStore</h1>
      </Navigation>
    );
  }
}

export default Nav;
